    <style type="text/css">
        polygon {
            stroke: #000;
            stroke-width: 1px;
        }

            polygon:hover {
                stroke: #FFF;
                fill: #000;
                stroke-width: 2px;
            }

        text {
            font-size: 12px;
            fill: #000;
            alignment-baseline: middle;
        }

            text:hover {
                fill: #F00;
                font-weight: bold;
            }

        g circle {
            stroke: #F00;
            stroke-width: 1;
            stroke-opacity: 0.8;
            fill: #000;
            fill-opacity: 0.5;
        }

        g.cities circle {
            stroke: #ff0;
            stroke-width: 1;
            stroke-opacity: 0.8;
            fill: #F00;
            fill-opacity: 0.8;
        }

        g.cities text {
            fill: #F00 !important;
            stroke: #FF0;
            ;
            stroke-width: 0.5px;
        }

        g.regions circle {
            stroke: #fff;
            stroke-width: 1;
            stroke-opacity: 0.3;
            fill: #000;
            fill-opacity: 0.3;
        }

        g.regions:hover text {
            fill: #fff;
            stroke: #000;
            stroke-width: 0.5px;
        }

        g.regions:hover circle {
            fill-opacity: 0.4;
        }

        g:hover circle {
            fill: #FF0;
            fill-opacity: 1;
            stroke-opacity: 1;
        }

        g text {
            fill: #000;
            font-size: 0px;
            fill-opacity: 0;
            alignment-baseline: middle;
            text-anchor: middle;
        }

        g:hover text {
            font-size: 30px;
            fill: #000;
            font-weight: bold;
            fill-opacity: 1;
        }
    </style>
